import React, { Component } from "react";
import { Map, GoogleApiWrapper, Marker } from "google-maps-react";

class MapContainer extends Component {
  state = {};
  render() {
    const mapStyles = {
      width: "100%",
      height: "100%"
    };

    const displayMarkers = () => {
      return this.props.ambulances.map(ambulance => {
        return (
          <Marker
            key={ambulance.id}
            id={ambulance.id}
            name={ambulance.vehicle_no}
            position={{
              lat: ambulance.lat,
              lng: ambulance.lng
            }}
            onClick={() =>
              console.log(`You have clicked ambulance no. ${ambulance.id}`)
            }
          />
        );
      });
    };

    return (
      //   <div>Hello</div>
      <Map
        google={this.props.google}
        zoom={14}
        style={mapStyles}
        initialCenter={{ lat: this.props.accident.lat, lng: accident.lng }}>
        <Marker
          key={this.props.accident.id}
          id={this.props.accident.id}
          name={this.props.accident.vehicle_no}
          position={{
            lat: this.props.accident.lat,
            lng: this.props.accident.lng
          }}
          icon={{
            url: "",
            anchor: new google.maps.Point(32, 32),
            scaledSize: new google.maps.Size(64, 64)
          }}
          onClick={() =>
            console.log(
              `You have clicked ambulance no. ${this.props.accident.id}`
            )
          }
        />
        {displayMarkers()}
      </Map>
    );
  }
}

// export default MapContainer;

export default GoogleApiWrapper({
  apiKey: "AIzaSyCE9NRqdC2ZRtLK42pUyEMW7flJJhXouIU"
})(MapContainer);
